import logo from './logo.svg';
import styles from './App.module.scss';
import { Link, Route} from "react-router-dom";
import Homepage from "./Homepage";
import Resume from "./Resume";
import Design from "./Design";
import Illustration from "./Illustration";

function App() {
  return (
    <div className={styles.App}>
      个人网站
      <header className={styles.header}>
        <div className={styles.box}>
          <div className={styles.boxleft}>
            <div className={styles.square}></div>
            <Link to="/"><div>Jiayu Wen</div></Link>
          </div>
          <div className={styles.boxright}>
            <Link to="/"><p>about me</p></Link>
            <Link to="/resume"><p>resume</p></Link>
            <Link to="/design"><p>design</p></Link>
            <Link to="/illustration"><p>illustration</p></Link>
          </div>
        </div>
      </header>
      <section className={styles.content}>
        <Route path="/" exact component={ Homepage }></Route>
        <Route path="/resume" exact component={ Resume }></Route>
        <Route path="/design" exact component={ Design }></Route>
        <Route path="/illustration" exact component={ Illustration }></Route>
      </section>
      <footer className={styles.footer}>
        <p><b>Location</b></p>
        <p>Stockholm, Sweden</p>
        <p><b>email</b></p>
        <p>jiayuwaern@gmail.com</p>
        <p>© 2021 by Jiayu Wen</p>
      </footer>
    </div>
  );
}

export default App;
